import React, { Component } from 'react';


//Componentes
import Navigation from './components/navigation';
import Footer from './components/footer';



export default class App extends Component{  

  render() {
    return(
      <div>
        <Navigation/> 
        <Footer />
      </div>      
    );
  }
}
